Musicien raffiné, Jean Cras [1879-1932] mena de front deux carrières : celle d'officier de marine et celle de compositeur (sur certains des bateaux à bord desquels il naviguait, un piano était à sa disposition dans sa cabine). L'une de ses trois filles, Colette Cras, devint en 1937 la seconde épouse d'Alexandre Tansman, compositeur lui aussi.
C'est en 1928, à bord du "Provence" (qui était alors le plus gros cuirassé en service de la marine nationale française), que Jean Cras composa son Quintette pour harpe, flûte, violon, alto et violoncelle. L'oeuvre est interprétée ici par Catherine Michel [harpe], Thomas Prévost [flûte], Marie-Christine Millière [violon], Jean-François Benatar [alto] et Philippe Bary [violoncelle]. Ses quatre mouvements portent les indications suivantes :
[00:00] Assez animé;
[05:37] Animé;
[12:24] Assez lent, sans traîner;
[18:37] Très animé.
